import {LOCALES} from "../locales";


export const Header = {
    [LOCALES.RUSSIAN]:{
        'about':'О НАС',
        'project' : "ПРОЕКТЫ",
        'contact' : "КОНТАКТЫ"
    },
    [LOCALES.KYRGYZ]:{
        'about':'БИЗ ЖӨНҮНДӨ',
        'project' : "ПРОЕКТТЕР",
        'contact' : "БАЙЛАНЫШТАР"
    },
    [LOCALES.ENGLISH]:{
        'about':'ABOUT US',
        'project' : "PROJECTS",
        'contact' : "CONTACTS"
    },
}
